import "./Profile.css";

const Profile = ({name, }) => {
  return (
    <div className="profile">
      <h3>Name: {props.name}</h3>
      <h3>Age: {props.age}</h3>
      <h3>From: {props.country}</h3>
    </div>
  );
};


export default Profile;
